document.addEventListener('DOMContentLoaded', () => {
    const searchInput = document.getElementById('searchInput');
    const searchButton = document.getElementById('searchButton');
    const resultsList = document.getElementById('resultsList');

    // ê²€ìƒ‰ ë²„íŠ¼ í´ë¦­ ì´ë²¤íŠ¸ ë¦¬ìŠ¤ë„ˆ ì¶”ê°€
    searchButton.addEventListener('click', performSearch);

    // ì—”í„° í‚¤ ì´ë²¤íŠ¸ ë¦¬ìŠ¤ë„ˆ ì¶”ê°€
    searchInput.addEventListener('keypress', (e) => {
        if (e.key === 'Enter') {
            performSearch();
        }
    });

    // ì €ì¥ ë²„íŠ¼ ì´ë²¤íŠ¸ ë¦¬ìŠ¤ë„ˆ ì¶”ê°€
    const saveButton = document.getElementById('saveButton');
    saveButton.addEventListener('click', () => {
        // ì €ì¥ ì¤‘ì„ì„ í‘œì‹œ
        resultsList.innerHTML = '<div style="text-align: center;">ëŒ€í™” ëª©ë¡ ì €ì¥ ì¤‘...</div>';

        // í˜„ì¬ í™œì„±í™”ëœ íƒ­ì—ì„œ content scriptë¡œ ì €ì¥ ìš”ì²­ ì „ì†¡
        chrome.tabs.query({active: true, currentWindow: true}, (tabs) => {
            if (tabs[0] && tabs[0].url.includes('gemini.google.com')) {
                chrome.tabs.sendMessage(tabs[0].id, {
                    action: 'save_chats'
                });
            } else {
                resultsList.innerHTML = '<div style="color: red;">Gemini ì›¹ì‚¬ì´íŠ¸ì—ì„œë§Œ ì‚¬ìš©í•  ìˆ˜ ìˆìŠµë‹ˆë‹¤.</div>';
            }
        });
    });

    function performSearch() {
        const searchTerm = searchInput.value.trim();
        if (!searchTerm) return;

        // ê²€ìƒ‰ ì¤‘ì„ì„ í‘œì‹œ
        resultsList.innerHTML = '<div style="text-align: center;">ê²€ìƒ‰ ì¤‘...</div>';

        // í˜„ì¬ í™œì„±í™”ëœ íƒ­ì—ì„œ content scriptë¡œ ê²€ìƒ‰ ìš”ì²­ ì „ì†¡
        chrome.tabs.query({active: true, currentWindow: true}, (tabs) => {
            if (tabs[0] && tabs[0].url.includes('gemini.google.com')) {
                chrome.tabs.sendMessage(tabs[0].id, {
                    action: 'search',
                    term: searchTerm
                });
            } else {
                resultsList.innerHTML = '<div style="color: red;">Gemini ì›¹ì‚¬ì´íŠ¸ì—ì„œë§Œ ì‚¬ìš©í•  ìˆ˜ ìˆìŠµë‹ˆë‹¤.</div>';
            }
        });
    }

    // ê²€ìƒ‰ ê²°ê³¼ í‘œì‹œ ë©”ì‹œì§€ ë¦¬ìŠ¤ë„ˆ
    chrome.runtime.onMessage.addListener((message) => {
        if (message.action === 'search_results') { // 'display_results' -> 'search_results'ë¡œ ìˆ˜ì •
            displayResults(message.results);
        } else if (message.action === 'save_complete') {
            if (message.success) {
                resultsList.innerHTML = '<div style="color: green;">ëŒ€í™” ëª©ë¡ì´ ì„±ê³µì ìœ¼ë¡œ ì €ì¥ë˜ì—ˆìŠµë‹ˆë‹¤.</div>';
            } else {
                resultsList.innerHTML = `<div style="color: red;">ì €ì¥ ì¤‘ ì˜¤ë¥˜ê°€ ë°œìƒí–ˆìŠµë‹ˆë‹¤: ${message.error || 'ì•Œ ìˆ˜ ì—†ëŠ” ì˜¤ë¥˜'}</div>`;
            }
        }
    });

    function displayResults(results) {
        resultsList.innerHTML = '';

        if (results.length === 0) {
            resultsList.innerHTML = '<div style="text-align: center;">ê²€ìƒ‰ ê²°ê³¼ê°€ ì—†ìŠµë‹ˆë‹¤.</div>';
            return;
        }

        results.forEach(result => {
            const resultItem = document.createElement('div');
            resultItem.className = 'result-item';
            resultItem.textContent = result.title;
            resultItem.addEventListener('click', () => {
                // ì„ íƒí•œ ëŒ€í™”ë¡œ ì´ë™ ìš”ì²­
                chrome.tabs.query({active: true, currentWindow: true}, (tabs) => {
                    chrome.tabs.sendMessage(tabs[0].id, {
                        action: 'open_chat',
                        chatId: result.chatId
                    });
                });
                // íŒì—… ë‹«ê¸°
                window.close();
            });
            resultsList.appendChild(resultItem);
        });
    }
});

